import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { HiOutlineUserCircle } from 'react-icons/hi'; // Importation de l'icône d'utilisateur de Tailwind CSS
import { signOut } from 'firebase/auth';
import { auth } from '../firebase-config';
import CopyrightText from '../Components/CopyrightText.jsx';

function Popup({ onClose }) {
  return (
    <div className="fixed inset-0 flex items-center justify-center z-50">
      <div className="absolute inset-0 bg-gray-800 opacity-50"></div>
      <div className="bg-white p-8 rounded shadow-lg">
        <button className="close-btn absolute top-0 right-0 m-4" onClick={onClose}>
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6 text-gray-500" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M6 18L18 6M6 6l12 12" />
          </svg>
        </button>
        <h2 className="text-2xl font-bold mb-4">Enregistrement réussi</h2>
        <p className="text-gray-700 mb-4">Votre numéro de matricule est :</p>
        <h1 className="text-4xl font-bold text-gray-900">120 903 23</h1>
      </div>
    </div>
  );
}

function HomePage() {
  const navigate = useNavigate(); // Déclaration de la fonction navigate
  const [showPopup, setShowPopup] = useState(false);

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        console.log('Déconnexion réussie');
        alert('Déconnexion réussie');
        navigate('/');
      })
      .catch((error) => {
        alert(error.message);
      });
  };

  const handleEnregistrerClick = () => {
    setShowPopup(true);
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Barre de navigation */}
      <nav className="bg-gray-800 py-4 px-8 flex justify-between items-center">
        <div className="text-white text-xl">Goblo</div>
        <div className="flex items-center">
          <HiOutlineUserCircle className="h-6 w-6 text-white mr-2" />
          <button className="text-white">Mon compte</button>
          <button onClick={handleLogout} className="text-white ml-4">Déconnexion</button>
        </div>
      </nav>

      {/* Contenu de la page */}
      <div className="container mx-auto px-4 py-8">
        {/* Logo */}
        <div className="text-center mb-8">
          <img className="mx-auto w-20 h-20" src="/logo.png" alt="Logo de l'application" />
        </div>

        {/* Cadres */}
        <div className="grid grid-cols-2 lg:grid-cols-3 gap-4">
          {/* Cadre Enroller */}
          <div onClick={handleEnregistrerClick} className="border border-gray-300 p-4 rounded-lg flex items-center justify-center bg-gray-200 hover:bg-gray-300 transition duration-300 cursor-pointer">
            {/* Icône */}
            <img className="w-12 h-12" src="hommes.png" alt="Icône" />
            {/* Texte */}
            <div className="ml-2">
              <div className="font-semibold">Enroller</div>
              <div>Enregistrer les contribuables</div>
            </div>
          </div>
          {/* Autres cadres */}
          {/* ... */}
        </div>
      </div>

      {/* Affichage du pop-up */}
      {showPopup && <Popup onClose={handleClosePopup} />}

      {/* Copyright */}
      <div className="text-center mt-auto py-8">
        <CopyrightText />
      </div>
    </div>
  );
}

export default HomePage;
